import GridCard from "../components/GridCard";

export default function DeprecatedCardContent({ title, contentData }) {
    return <div className="container mt-5">
    <div className="row">

    </div>
        <h1>- {title} -</h1>
        {
            contentData.map(contentSet => (
                <div className="container col-md-4" key={contentSet.id}>
                    <GridCard title={contentSet.title} content={contentSet.content} date={contentSet.date} />
                </div>
            ))
        }
    </div>
}
